webpackJsonp([99236298180895],{1083:function(e,a){e.exports={data:{package:{id:"immutable-re",score:.5410148377119999,name:"immutable-re",version:"0.0.15",description:"Persistent immutable collections for Reason",keywords:["immutable","ocaml"],license:"BSD-3-Clause",updated:"2017-12-22T21:11:13.844Z",stars:176,type:"published",quality:.7382175232390178,popularity:.08661627201815367,maintenance:.8263825300969738,readme:'<h1><img src="https://github.com/facebookincubator/immutable-re/raw/master/docs/images/logo-800x215.png?raw=true" alt="Immutable Collections For Reason"></h1>\n<p>Pure <a href="https://facebook.github.io/reason">Reason</a> implementation of persistent immutable data structures.</p>\n<h1>Features</h1>\n<p>Immutable-re provides a complete set of efficient persistent immutable data\nstructures for <a href="https://facebook.github.io/reason">Reason</a> and <a href="http://www.ocaml.org/">OCaml</a>,\ntargeting both OCaml native and byte code compilation modes, as well JavaScript using\n<a href="https://github.com/bloomberg/bucklescript">BuckleScript</a>.</p>\n<p>The api includes concrete implementations of vectors, sets, and maps. Many\nimplementations support <a href="http://clojure.org/reference/transients">transient mutability</a>\nfor efficient batch mutations. Additionally Immutable-re provides lazy\nfunctional iterators and sequences, along with type definitions for basic operators\nsuch as equality, comparison, and hashing.</p>\n<p>For more details see the <a href="http://facebookincubator.github.io/immutable-re/api.html">API docs</a>.</p>\n<h1>Installing</h1>\n<h2>Installing via NPM (JS Workflow)</h2>\n<pre><code class="language-bash">npm install --save immutable-re\n</code></pre>\n<h2>Installing <code>immutable</code> via OPAM (native workflow)</h2>\n<pre><code class="language-bash"># On macOS, install opam via Homebrew:\nbrew update\nbrew install opam\n# On Linux, see here (you will need opam >= 1.2.2): http://opam.ocaml.org/doc/Install.html\n\nopam init\n# Add this to your ~/.bashrc (or ~/.zshrc):\n#   eval $(opam config env)\n\nopam update\nopam switch 4.02.3\neval $(opam config env)\nopam install immutable\n</code></pre>\n<h2>Contributing to development</h2>\n<pre><code class="language-bash"># On macOS, install opam via Homebrew:\nbrew update\nbrew install opam\n# On Linux, see here (you will need opam >= 1.2.2): http://opam.ocaml.org/doc/Install.html\n\nopam init\n# Add this to your ~/.bashrc (or ~/.zshrc):\n#   eval $(opam config env)\n\nopam update\nopam switch 4.02.3\neval $(opam config env)\ngit clone git@github.com:facebookincubator/immutable-re.git\ncd immutable-re\nopam pin add -y immutable .\n</code></pre>\n<h1>Status</h1>\n<p>Immutable-re is under active development and is not yet production ready. We are\nreleasing this early alpha to get community input and contributions. If you are\ninterested in contributing please follow the directions <a href="https://github.com/facebookincubator/immutable-re/blob/master/CONTRIBUTING.md">here</a>.</p>\n<p>For JavaScript developers needing production ready immutable collections,\nwe recommend using the <a href="https://github.com/BuckleTypes/bs-immutablejs.git">Reason BuckleScript bindings to Immutable.js</a>.</p>\n<h2>License</h2>\n<p>Immutable-re is <a href="https://github.com/facebookincubator/immutable-re/blob/master/LICENSE.txt">BSD-licensed</a>. We also provide an additional <a href="https://github.com/facebookincubator/immutable-re/blob/master/PATENTS.txt">patent grant</a>.</p>\n',homepageUrl:"https://facebookincubator.github.io/immutable-re/",repositoryUrl:"https://github.com/facebookincubator/immutable-re",npmUrl:"https://www.npmjs.com/package/immutable-re",issuesUrl:"https://github.com/facebookincubator/immutable-re/issues",slug:"packages/immutable-re"}},pathContext:{id:"immutable-re"}}}});
